import React from 'react';
import c from './Dialogs.module.css';

const Dialogs = () => {
    return (
        <div className={c.dialogs}>
            <div className={c.dialogs_item}>
                <div className = {c.item}>
                    Danon
                </div>
                <div className = {c.item}>
                    NELOX
                </div>
                <div className = {c.item}>
                    mckurgan2005
                </div>
                <div className = {c.item}>
                    Daunil\
                </div>
            </div>
        </div>
    );
}
export default Dialogs;
